NewsFeed\httpsfeedqgisorg\40\sticky=false
NewsFeed\httpsfeedqgisorg\40\title=Crowdfunding Appeal: Improved Point Cloud Support
NewsFeed\httpsfeedqgisorg\41\content=<p>Our developers have discovered a critical issue in <strong>QGIS 3.16.12</strong> which may cause plugins (and QGIS) to hang on Windows. All users of QGIS 3.16.12 are encouraged to upgrade to <strong>3.16.13</strong>. Double Clicking this message will take you to the download page.</p>
