NewsFeed\httpsfeedqgisorg\41\link=@Variant(\0\0\0\x11\0\0\0/https://qgis.org/en/site/forusers/download.html)
NewsFeed\httpsfeedqgisorg\41\sticky=false
NewsFeed\httpsfeedqgisorg\41\title=Critical Fix Announcement: Update to 3.16.13
NewsFeed\httpsfeedqgisorg\43\content="<p>In our ongoing efforts to ensure the highest quality of the releases we publish, we would like to advise you of a critical issue found in the QGIS LTR 3.16.12 and QGIS LTR 3.16.13 MSI releases. Preparation of the 3.16.14 MSI build, which should address the issue, is underway and should be available on Friday 19 November 2021. In the interim, if you are using either of these affected MSI builds we advise you to immediately revert to QGIS 3.16.11 MSI. The download for QGIS 3.16.11 MSI is available here:<br /><br />https://qgis.org/downloads/QGIS-OSGeo4W-3.16.11-1.msi<br /><br />Double clicking this news entry will cause it to download directly. We apologise for any inconvenience.</p>"
